define('coreJS/app/views/originView',['require','backbone','coreJS/app/origin'],function(require){

  var Backbone = require('backbone');
  var Origin = require('coreJS/app/origin');

  var OriginView = Backbone.View.extend({

    settings: {
      autoRender: true
    },

    initialize: function(options) {
      this.preRender(options);
      if (this.settings.autoRender) {
        this.render();
      }
      this.listenTo(Origin, 'remove:views', this.remove);
      this.listenTo(Origin, 'origin:showLoading', this.showLoading);
      this.listenTo(Origin, 'origin:hideLoading', this.hideLoading);
    },

    preRender: function() {},

    render: function() {
      var data = this.model ? this.model.toJSON() : null;
      var template = Handlebars.templates[this.constructor.template];
      this.$el.html(template(data));
      _.defer(_.bind(function() {
        this.postRender();
        this.onReady();
      }, this));
      return this;
    },

    postRender: function() {},

    onReady: function() {},

    showLoading: function () {
      $('.loading').show();
    },

    hideLoading: function () {
      $('.loading').hide();
    },

    sortArrayByKey: function (arr, key) {
      return arr.sort(function(a, b){
        var keyA = a[key],
        keyB = b[key];
        if(keyA < keyB) return -1;
        if(keyA > keyB) return 1;
        return 0;
      });
    }

  });

  return OriginView;

});

define('coreJS/user/views/loginView',['require','backbone','coreJS/app/origin','coreJS/app/views/originView'],function(require) {
  var Backbone = require('backbone');
  var Origin = require('coreJS/app/origin');
  var OriginView = require('coreJS/app/views/originView');

  var LoginView = OriginView.extend({

    className: 'login',

    tagName: "div",

    events: {
      'keydown #login-input-username' : 'clearErrorStyling',
      'click .login-form-submit':'submitLoginDetails'
    },

    preRender: function() {
      this.listenTo(Origin, 'login:failed', this.loginFailed, this);
    },
    
    clearErrorStyling: function(e) {
      $('#login-input-username').removeClass('input-error');
      $('#loginErrorMessage').text('');
    },

    submitLoginDetails: function(e) {
      e.preventDefault();

      var inputUsernameEmail = $.trim(this.$("#login-input-username").val());
      var inputPassword = $.trim(this.$("#login-input-password").val());

      // Validation
      if (inputUsernameEmail === '' || inputPassword === '') {
        this.loginFailed();
      } else {
        $('#login-input-username').removeClass('input-error');
      }

      var userModel = this.model;

      userModel.login(inputUsernameEmail, inputPassword, function(err, result){
        if( err || !result.success) {
          this.loginFailed();
        } else {
          Backbone.history.navigate('#/dashboard', {trigger: true});
        }
      });
    },

    loginFailed: function() {
      $('#login-input-username').addClass('input-error');
      $('#loginErrorMessage').text(window.polyglot.t('app.invalidusernameoremail'));

      return false;
    }

  }, {
    template: 'login'
  });

  return LoginView;

});

